const MODEL_URL  = "./gpt2.onnx"; // Path/URL to your ONNX model
const MAX_NEW_TOKENS = 20; // how many tokens to generate

function base64ToText(b64) {
  return new TextDecoder("utf-8").decode(Uint8Array.from(atob(b64), c => c.charCodeAt(0)));
}

/* === Load vocab & merges === */
const vocab = JSON.parse(base64ToText(VOCAB_B64));
const merges = base64ToText(MERGES_B64)
  .split(/\r?\n/)
  .map(l => l.trim())
  .filter(l => l && !l.startsWith("#"));
const vocabSize = Object.keys(vocab).length;

/* === Canonical GPTâ€‘2 byte/unicode mapping === */
function bytesToUnicode() {
  const bs = [];
  for (let i = 33; i <= 126; ++i) bs.push(i);
  for (let i = 161; i <= 172; ++i) bs.push(i);
  for (let i = 174; i <= 255; ++i) bs.push(i);
  const cs = bs.slice();
  let n = 0;
  for (let b = 0; b < 256; ++b) {
    if (!bs.includes(b)) {
      bs.push(b);
      cs.push(256 + n);
      ++n;
    }
  }
  const byteToUnicode = new Map();
  const unicodeToByte = new Map();
  for (let i = 0; i < bs.length; i++) {
    const b = bs[i], c = cs[i];
    const ch = String.fromCharCode(c);
    byteToUnicode.set(b, ch);
    unicodeToByte.set(ch, b);
  }
  return { byteToUnicode, unicodeToByte };
}
const { byteToUnicode, unicodeToByte } = bytesToUnicode();

/* === Tokenizer === */
function getEncoder(vocab, merges) {
  const bpeRanks = new Map(merges.map((v, i) => [v, i]));
  const encoder = vocab;
  const decoder = {};
  for (const k in encoder) decoder[encoder[k]] = k;
  const cache = new Map();

  function getPairs(word) {
    const pairs = new Set();
    let prev = word[0];
    for (let i = 1; i < word.length; i++) {
      pairs.add([prev, word[i]]);
      prev = word[i];
    }
    return pairs;
  }

  function bpe(token) {
    if (cache.has(token)) return cache.get(token);
    let word = token.split("");
    if (word.length === 0) return "";
    let pairs = getPairs(word);
    while (true) {
      let minPair = null, minRank = Infinity;
      for (const pair of pairs) {
        const rank = bpeRanks.get(pair.join(" "));
        if (rank !== undefined && rank < minRank) {
          minRank = rank;
          minPair = pair;
        }
      }
      if (minPair == null) break;
      const [first, second] = minPair;
      const newWord = [];
      let i = 0;
      while (i < word.length) {
        const j = word.indexOf(first, i);
        if (j === -1) {
          newWord.push(...word.slice(i));
          break;
        }
        newWord.push(...word.slice(i, j));
        i = j;
        if (word[i] === first && i < word.length - 1 && word[i + 1] === second) {
          newWord.push(first + second);
          i += 2;
        } else {
          newWord.push(word[i]);
          i += 1;
        }
      }
      word = newWord;
      if (word.length === 1) break;
      pairs = getPairs(word);
    }
    const out = word.join(" ");
    cache.set(token, out);
    return out;
  }

  const GPT2_PATTERN = new RegExp(
    "'s|'t|'re|'ve|'m|'ll|'d| ?\\p{L}+| ?\\p{N}+| ?[^\\s\\p{L}\\p{N}]+|\\s+(?!\\S)|\\s+",
    "gu"
  );

  function encode(text) {
    let transformed = "";
    for (const b of new TextEncoder().encode(text)) {
      transformed += byteToUnicode.get(b);
    }
    const bpeTokens = [];
    for (const match of transformed.matchAll(GPT2_PATTERN)) {
      const token = match[0];
      const bpePieces = bpe(token).split(" ").filter(Boolean); // filter empties
      for (const p of bpePieces) {
        if (!(p in encoder)) {
          console.error("Unknown token:", JSON.stringify(p));
          throw new Error("Unknown token in encoder: " + p);
        }
        bpeTokens.push(encoder[p]);
      }
    }
    return bpeTokens;
  }

  function decode(tokens) {
    const text = tokens.map(t => decoder[t]).join("");
    const bytes = new Uint8Array(text.length);
    for (let i = 0; i < text.length; i++) {
      const ch = text[i];
      bytes[i] = unicodeToByte.has(ch) ? unicodeToByte.get(ch) : ch.charCodeAt(0);
    }
    return new TextDecoder("utf-8").decode(bytes);
  }

  return { encode, decode };
}
const tokenizer = getEncoder(vocab, merges);

/* === Safe argMax === */
function argMax(array) {
  let maxIndex = 0, maxValue = array[0];
  for (let i = 1; i < array.length; i++) {
    if (array[i] > maxValue) {
      maxValue = array[i];
      maxIndex = i;
    }
  }
  return maxIndex;
}

/* === ONNX Inference === */
let session;
async function init() {
  session = await ort.InferenceSession.create(MODEL_URL, { executionProviders: ["wasm"] });
  console.log("ONNX model loaded.");
}

async function generate() {
  const prompt = document.getElementById("prompt").value;
  let generated = tokenizer.encode(prompt);

  for (let step = 0; step < MAX_NEW_TOKENS; step++) {
    const attnMask = new Array(generated.length).fill(1);
    const posIds = [...Array(generated.length).keys()];

    const feeds = {
      input_ids: new ort.Tensor("int64", BigInt64Array.from(generated.map(BigInt)), [1, generated.length]),
      attention_mask: new ort.Tensor("int64", BigInt64Array.from(attnMask.map(BigInt)), [1, generated.length]),
      position_ids: new ort.Tensor("int64", BigInt64Array.from(posIds.map(BigInt)), [1, generated.length]),
    };

    const results = await session.run(feeds);
    const logits = results[Object.keys(results)[0]];
    const lastLogits = logits.data.slice(-vocabSize);
    const nextToken = argMax(lastLogits);
    generated.push(nextToken);
  }

  document.getElementById("output").textContent = tokenizer.decode(generated);
}

init();
